string _Parsers::JSONParser(string JSON)
{
    string response = "";

    for (int x = 0; x <= JSON.length(); x++)
    {
        if (JSON[x] == '\"' && JSON[x + 1] == 'r' && JSON[x + 2] == 'e' && JSON[x + 3] == 's' && JSON[x + 4] == 'p' && JSON[x + 5] == 'o' && JSON[x + 6] == 'n' && JSON[x + 7] == 's' && JSON[x + 8] == 'e' && JSON[x + 9] == '\"' && JSON[x + 10] == ':' && JSON[x + 11] == '\"')
        {
            for (int y = x + 12; y <= JSON.length(); y++)
            {
                if (JSON[y] == '\"' && JSON[y + 1] == ',' && JSON[y + 2] == '\"' && JSON[y + 3] == 'd' && JSON[y + 4] == 'o' && JSON[y + 5] == 'n' && JSON[y + 6] == 'e' && JSON[y + 7] == '\"' && JSON[y + 8] == ':' && JSON[y + 9] == 't' && JSON[y + 10] == 'r' && JSON[y + 11] == 'u' && JSON[y + 12] == 'e')
                {
                    return response;
                }
                else
                {
                    response += JSON[y];
                }
            }
            break;
        }
    }

    return response;
}

